class ColorComp extends Component {
  constructor() {
    super();
  }

  render() {
    return (
      <div className="ColorBox">
        <div style={{ backgroundColor: `${this.props.boxCol}` }}></div>
      </div>
    );
  }
}

export default ColorComp;
